import React from 'react';

const hospitalityImages = [
  'IMG_3870.jpg',
  'IMG_1117.jpg',
  'IMG_180.jpg',
  'IMG_1210.jpg',
  'IMG_1216.jpg',
  'IMG_5331.jpg',
  'IMG_1326.jpg',
  'IMG_3869.jpg',
];

export default function HospitalityGallery() {
  return (
    <div style={{ padding: '2rem', textAlign: 'center' }}>
      <h2 style={{ fontSize: '2rem', fontWeight: 'bold', marginBottom: '1rem' }}>Hospitality Gallery</h2>
      <div
        style={{
          display: 'flex',
          flexWrap: 'wrap',
          justifyContent: 'center',
          gap: '20px',
          marginTop: '1rem',
          maxWidth: '640px',
          marginLeft: 'auto',
          marginRight: 'auto',
        }}
      >
        {hospitalityImages.map((img, idx) => (
          <img
            key={img}
            src={process.env.PUBLIC_URL + '/hospitality/' + img}
            alt={`Hospitality ${idx + 1}`}
            style={{ width: '300px', borderRadius: '8px' }}
          />
        ))}
      </div>
    </div>
  );
}
